The '''Lee Medical Building''' is a historic office building located in [[Richmond, Virginia]]. It was constructed in 1952, and is a six-story, {{convert|40,000|sqft|sqm|adj=mid}} building designed in the [[Colonial Revival]] style. The building occupies a prominent site on [[Monument Avenue]] in the city, located on a corner lot across from and facing the since-removed [[Robert E. Lee Monument (Richmond, Virginia)|Robert E. Lee Monument]], and was the only office building in that primarily residential neighborhood.
It resides within the [[Monument Avenue Historic District]], but was built outside of that area's period of significance and so is not a contributing structure. The office building itself was listed to the [[National Register of Historic Places]] in 2018.<ref name=VAnom>{{cite web |last=Friedberg |first=Dara A. |date=July 2017 |title=Lee Medical Building Final Nomination |url=https://www.dhr.virginia.gov/wp-content/uploads/2018/09/127-0174-0393_Lee_Medical_Building_2017_NRHP_nomination_FINAL.pdf |publisher=Virginia Department of Historic Resources |access-date=February 19, 2024}}</ref>
